import React from 'react';
// import './About.scss';



const About: React.FC = (props) => {
    return (
        <div className="about-container">
            <h1>Hey, I'm Hans.</h1>
            <p>I am a software engineer based in Los Angeles, CA .
                I graduated from the <a href="https://ucsd.edu/">University of California, San Diego</a>
                 with a Bachelors in Computer Science.
            </p>
        </div>
    );
}

export default About
